import React from "react";
import "./footer.css";

const Footer = () => {
  return (
    <div className="footer">
      <p class="line1">
        <span> Adress: </span>Fänriksgatan 3 - Göteborg
      </p>
      <p class="line2"> (Alldeles intill rondellen vid hållplats Bellevue)</p>
    </div>
  );
};

export default Footer;
